	private void jj_rescan_token() {
		jj_rescan = true;
		for (int i = 0; i < 7; i++) {
			try {
				JJCalls p = jj_2_rtns[i];

				do {
					if (p.gen > jj_gen) {
						jj_la = p.arg;
						jj_lastpos = jj_scanpos = p.first;
						switch (i) {
						case 0:
							jj_3_1();
							break;
						case 1:
							jj_3_2();
							break;
						case 2:
							jj_3_3();
							break;
						case 3:
							jj_3_4();
							break;
						case 4:
							jj_3_5();
							break;
						case 5:
							jj_3_6();
							break;
						case 6:
							jj_3_7();
							break;
						}
					}
					p = p.next;
				} while (p != null);

			} catch (LookaheadSuccess ignored) {
			}
		}
		jj_rescan = false;
	}

	private void jj_save(int index) {
		JJCalls p = jj_2_rtns[index];
		while (p.gen > jj_gen) {
			if (p.next == null) {
				p = p.next = new JJCalls();
				break;
			}
			p = p.next;
		}

		p.gen = jj_gen + 2 - jj_la;
		p.first = token;
		p.arg = 2;
	}

